import logo from '../logo.svg';
import '../App.css';
import Navbar from '../Navbar/Navbar';
import React, { useState } from "react";
import { Tabs, Tab } from "react-bootstrap";

function Profil() {
  const [key, setKey] = useState("mes-post");

  return (
    <div>
      <div className="user-profile">
        <img src="url_de_l'image" alt="user-profile-img" />
        <h2>Nom de l'utilisateur</h2>
        <p>Prénom de l'utilisateur</p>
        <p>Email de l'utilisateur</p>
        <p>Mot de passe de l'utilisateur</p>
      </div>

      <Tabs activeKey={key} onSelect={(k) => setKey(k)}>
        <Tab eventKey="mes-post" title="Mes Posts">
          <div className="mes-posts">
            {/* Afficher ici les posts de l'utilisateur */}
          </div>
        </Tab>
        <Tab eventKey="gerer-mon-compte" title="Gérer Mon Compte">
          <div className="gerer-mon-compte">
            {/* Afficher ici les options de gestion de compte */}
          </div>
        </Tab>
      </Tabs>
    </div>
  );
}


export default Profil;
